import React from "react";

interface Product {
    id: number,
    name: string,
    weight: number,
    energy: number,
    proteins: number,
    carbohydrates: number,
    fats: number
  }

const SearchResult = ({ result }: {result: string}) => {
    return (
      <div onClick={(e) => alert(`You selected ${result}!`)}>{result}</div>
    );
  };

const SearchResultsList = ({ results }: {results: Product[]}) => {
  return (
    <div>
      {results.map((result, id) => {
        return <SearchResult result={result.name} key={id} />;
      })}
    </div>
  );
};

export default SearchResultsList;
